import React from 'react'

function Shoppreview({title , items}) {


    return (
        <div className='shop-preview'>
             <div className='shop-prev'>
             <h1>{title.toUpperCase()}</h1>
              <div>
                  {items
                  .
                  map( item => (
                     <h4>{item.name}</h4> 
                  ))}
              </div>
             </div>
        </div>
    )
}

export default Shoppreview
